const Hero = ({ slice }) => {
	const { width, height } = slice.primary.bg.dimensions;
	return (
		<section>
			<Image
				src={slice.primary.bg.url}
				width={width}
				height={height}
				layout="responsive"
			/>
		</section>
	);
};

export default Hero;
